,tr_ff2196abefadc23312171aec96c2bc5f:" (en utilisant UTC ",tr_e59dd8d25c0b6bb6697eac0617ccd412:" Ci-dessous ",tr_5b469fd01889ec12f1e84c6e66829fc1:" Au-dessus ",tr_655d20c1ca69519ca647684edbb2db35:" Élevée ",tr_28d0edd045e05cf5af64e35ae0c4c6ef:" Faible ",js_a850349046d95786a28d0fb682236183:" Comment ça marche : Le modèle formé prédit le prochain point de données à partir de modèles historiques et mesure la différence entre la valeur prévue et la valeur réelle. Plus l'écart est élevé, plus le degré d'anomalie est élevé. De plus, elle fournit une mesure de certitude que nous appelons marge de fluctuation et est visualisée par une zone bleu clair autour de la ligne qui indique le degré d'anomalie. Plus cette zone est étroite pour un point de données spécifique, plus la confiance peut être accordée à la production.  Le curseur de sensibilité règle le seuil du degré d'anomalie au-dessus duquel une alarme est déclenchée. ",js_8ae816c5e6f7526e7d00ef4806d1557a:" Veuillez préciser l'intervalle dans lequel nous vérifions les nouvelles alertes. L'intervalle peut être compris entre une heure et 24 heures. Par exemple, vous pouvez définir vos alertes sur la base de données horaires, mais vérifiez toutes les 12 heures si une alerte est survenue à un moment quelconque au cours des 12 dernières heures. ",js_f3cab1f93d4ce803b23165d578dd5b9f:" Dans cette étape, vous pouvez sélectionner l'algorithme qui est appliqué pour détecter une anomalie et déclencher une alerte dans votre série de données. ",js_3dc62674a4a44ecc0b06c6f506554071:" La préparation de l'ensemble des données d'entrée et la formation du modèle peuvent prendre quelques minutes. ",js_a32d6f77b4cd387776263c94eaaa52ff:" 12 heures ",js_e1f57d0c474bedaae9c88fad138dcfd0:" 24 heures ",js_88f1efb29dc20c4b7c6ae2653b3f778c:" 6 heures ",js_72ab9d0304d3e84c6aa2dd15eda282f2:" 1 heure ",js_b3c2a4f81fdfecd23731d65933cd048a:" Cette approche déclenche une alarme lorsque la valeur observée tombe en dessous / dépasse une valeur absolue. ",js_44d3c8ed4d2a3709ec846769285f0253:" Reconnaissance et prévision des motifs <forte>Reconnaissance et prévision des motifs </forte><br>>. ",js_ac4a6be23fbc43b06184d00feba5e0dc:" Seuil - Variation relative en % </strong><br><br> seuil - Variation relative en % </strong><br> seuil ",js_3a6589584b9fddb325e17a2a1b06eaa2:" Seuil - Valeurs absolues </strong><br><br> Valeurs absolues ",js_2f7ab6d5f37efd431861a58d61378989:" <strong>Neural Network</strong><br>>Neural Network ",js_88a4b667a4ab9949a02f26b05106a04e:" Reconnaissance et prévision des patrons ",js_5e5bcf0259d0ec6534a239e80123e554:" Seuil - Variation relative en pourcentage ",js_797f58765bfaba8727cf296a35426e5e:" Seuil - Valeurs absolues ",js_cbfbd568859a11e345d2291aca9becfa:" Notification personnalisée ",js_9b8c887fa80e1d96052064423091387a:" Réseau neuronal ",js_1d339a0d6be376ba1f97e1880e71ca97:" Options e-mail ",js_bcbe9b6ae88662c62d994cf5525df74c:" Données mensuelles ",js_599fe8ff7d3df259d21b644b6b5b020a:" Données hebdomadaires ",js_759cb674be0ed2b80cd9497df158861f:" Données horaires ",js_a828a6a10020b778ded7d4fb75112cf8:" Données quotidiennes ",js_ea49b06f6dd20a7da7cc2fec799fad56:" Cet algorithme d'apprentissage machine identifie et mesure les tendances saisonnières et les tendances dans les données historiques d'entraînement. Sur la base de ces informations, la valeur de la période suivante (heure ou jour) peut être prédit assez précisément en supposant que l'ensemble de données montre des tendances claires. Plus les tendances sont fortes, plus la prédiction est précise. Enfin, la valeur prévisionnelle est comparée à la valeur réelle de la période en cours. Si la valeur réelle diffère significativement de la valeur prévue, alors le modèle connu est brisé, indiquant un événement inattendu. La plage d'écart autorisé par rapport à la valeur prévue peut être ajustée à l'aide du curseur Sensibilité. ",js_9989c1c238ff780c52ef78fdada292f5:" Cet algorithme d'intelligence artificielle est basé sur le réseau neuronal le plus avancé utilisé dans le domaine de la détection des anomalies et modélise certaines des propriétés structurelles et algorithmiques du néocortex. Il combine et étend les approches utilisées dans la mémoire répartie éparse, les réseaux bayésiens, les algorithmes de clustering spatial et temporel, tout en utilisant une hiérarchie de nœuds en forme d'arbre qui est commune dans les réseaux neuronaux. ",tr_f262fae0a2f17e8c1eb4e9eddb0160e4:" Procéder ",js_3f1f7bf6ef002b9279e0f6e07643a6a3:" Cette approche calcule la variation en pourcentage pour chaque point de données par rapport à la valeur précédente. Par exemple, si la valeur actuelle est 30 et la valeur précédente est 20, la sortie du modèle serait une valeur de 50%. Comme paramètre d'entrée, vous pouvez définir un seuil inférieur et/ou supérieur qui déclenche une alarme si la valeur baisse / augmente de plus d'un certain pourcentage par rapport à la période précédente. ",js_a6c13740ac8d93b9a8aafb94a1cc587b:" Vous pouvez également modifier l'heure à laquelle les contrôles des alertes doivent être effectués. Par défaut, il est réglé à 0:00. ",js_4675c7faf2d5514378f16b4e03365367:" Veuillez préciser si vous souhaitez surveiller les valeurs horaires, journalières, hebdomadaires ou mensuelles. Par exemple, les valeurs horaires, les algorithmes fonctionnent sur la base des valeurs agrégées par heure (par exemple, le nombre de visiteurs du site Web par heure). Le réseau neuronal et la reconnaissance et la prévision des formes ne sont pas disponibles pour les valeurs hebdomadaires et mensuelles. ",js_70967582acc6682a9e16bcb79f34e8bf:" Cet intervalle définit également la fréquence à laquelle vous recevez les notifications par e-mail en cas de déclenchement d'une alerte. Par exemple, si vous avez sélectionné \"24 heures\", vous recevrez un email par jour (si une alerte a eu lieu) à l'heure sélectionnée ci-dessous. ",js_d2ce009594dcc60befa6a4e6cbeb71fc:" Semaine ",js_7cbb885aa1164b390a0bc050a64e1812:" Mois ",js_2e2def501f212